                { name:'Undying', role: 'Support', attribute: 'Str',advantage: -1.9, image: 'https://static.wikia.nocookie.net/dota2_gamepedia/images/6/61/Undying_icon.png/revision/latest/scale-to-width-down/256?cb=20160411212333'},
                { name:'Techies', role: 'Support', attribute: 'Int',advantage: -2.7, image: 'https://static.wikia.nocookie.net/dota2_gamepedia/images/f/fa/Techies_icon.png/revision/latest/scale-to-width-down/256?cb=20160411215855'},
                { name:'Spectre', role: 'Core', attribute: 'Agi',advantage: -5.41, image: 'https://static.wikia.nocookie.net/dota2_gamepedia/images/f/ff/Spectre_icon.png/revision/latest/scale-to-width-down/256?cb=20160411214336'},
                { name:'Zeus', role: 'Core', attribute: 'Int',advantage: -6.23, image: 'https://static.wikia.nocookie.net/dota2_gamepedia/images/3/3f/Zeus_icon.png/revision/latest/scale-to-width-down/256?cb=20160411215025'},
                { name:'Medusa', role: 'Core', attribute: 'Agi',advantage: -7.14, image: 'https://static.wikia.nocookie.net/dota2_gamepedia/images/c/cc/Medusa_icon.png/revision/latest/scale-to-width-down/256?cb=20160411214604'},
              ]
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className = 'TitleBar'>
          <img src= {image} alt="No Antimage" style={{height: "5vw"}}/> 
          <div className = 'TitleText'>
            <div>
            The Anti-AntiMage App: An AntiMage Counterpicker Tool
            </div>
          </div>
        </div>
        <div className = 'About'>
          Antimage is the least fun hero to play against in Dota 2 with over 50% ban rate. 
          This app helps you draft an antimage-resistant team.
        </div>
        <div className = 'MainPane'>
          <FilteredList list={heroes} />
        </div>
      </header>
    </div>
  );
}

export default App;
